import React from 'react';
import { TextField, Grid, Button } from '@mui/material'

function Filter({ handleFilter }) {
  return (
    <form>
      <TextField />
      <TextField />
      <Button onSubmit={handleFilter}></Button>
    </form>
  );
}

export default Filter;
